import React from 'react';

const Card = () => {
    return (
        <div className='bg-light-green dib br3 pa3 ma2 grow flex-wrap justify-center'>
            <img src='https://robohash.org/tester?200x200' alt='robots'/>
            <div>
                <h2>
                    Jane Doe
                </h2>
                <p>
                    jane.doe@gmail.com
                </p>
            </div>
        </div>
    );
}

export default Card;
